description:
Joey: The Man Who Conquered the TT

Travel Documentary hosted by Cally Elise Statham, published by ITV in 2013 - English narration


Information
------------------------------

An intimate documentary about one of the most remarkable sportsmen of all time - Joey Dunlop the pub landlord and rider who won Isle of Man TT a staggering 26 times. In 2000, a few weeks after winning the TT Joey died in a freak accident in the woods of Estonia. This is the incredible story of how one determined middle aged man pushing 50 beat the odds, only to be cut down in tragic circumstances. With contributions from John McGuinness, Phil McCallen, Brian Reid, Mick Grant, Ron Haslam, Roger Marshall, Jim Dunlop and Neil Tuxworth.

